import React from "react";

// Responsive device hook
function useIsMobile(breakpoint = 600) {
    const [isMobile, setIsMobile] = React.useState(window.innerWidth < breakpoint);
    React.useEffect(() => {
        function handleResize() { setIsMobile(window.innerWidth < breakpoint); }
        window.addEventListener("resize", handleResize);
        return () => window.removeEventListener("resize", handleResize);
    }, [breakpoint]);
    return isMobile;
}

const WORKS = [
    {
        role: "Houskeeping Team Lead and Supervisor",
        company: "Global Hospitality Solutions pty Ltd.",
        period: "Jan 2025 – Present",
        location: "Sydney, Australia",
        summary: "Managed a team of 20+ staff, coordinating schedules and workflows to ensure operational efficiency and high-quality service. Optimised processes and tracking systems, improving task completion accuracy by 25%. Leveraged problem-solving and communication skills to resolve operational challenges, demonstrating teamwork, leadership, and adaptability in an Australian workplace environment.",
        stack: [
            {
                name: "Teamwork & Collaboration",
                description: "What I did: Coordinated with a diverse team of 20+ staff members to manage daily schedules, workflows, and task assignments in a fast-paced hospitality environment. Achievements: Fostered a collaborative atmosphere that led to seamless operations and a 25% improvement in overall task completion accuracy. Correlation to transferable IT skills: In IT, teamwork is vital for agile development processes, code reviews, and cross-functional collaboration on projects, ensuring efficient delivery of software solutions."
            },
            {
                name: "Problem-Solving & Critical Thinking",
                description: "What I did: Identified and resolved operational challenges, such as workflow bottlenecks and resource allocation issues, through analytical thinking and quick decision-making. Achievements: Implemented solutions that optimized processes, resulting in a 25% increase in task accuracy and reduced downtime. Correlation to transferable IT skills: These skills directly apply to debugging code, troubleshooting system errors, and developing innovative algorithms in IT environments."
            },
            {
                name: "Process Optimisation & Attention to Detail",
                description: "What I did: Analyzed existing processes and tracking systems, identifying inefficiencies and implementing detailed improvements for better accuracy and efficiency. Achievements: Achieved a 25% improvement in task completion rates by refining workflows and ensuring meticulous oversight. Correlation to transferable IT skills: Essential for optimizing code performance, managing databases, and conducting thorough quality assurance testing to minimize errors in software development."
            },
            {
                name: "Communication & Stakeholder Management",
                description: "What I did: Facilitated clear communication between team members, supervisors, and stakeholders to address issues and align on goals in a multicultural Australian workplace. Achievements: Maintained high service quality and resolved conflicts effectively, contributing to operational success and team adaptability. Correlation to transferable IT skills: Critical for client interactions, team stand-ups, requirement gathering, and technical documentation in IT projects."
            }
        ]
    }
];

export default function WorkPage() {
    const isMobile = useIsMobile();
    const [hoveredSkill, setHoveredSkill] = React.useState(null);

    return (
        <div style={{
            maxWidth: isMobile ? "99vw" : 900,
            margin: isMobile ? "18px auto" : "52px auto",
            padding: isMobile ? "0 3vw" : "0 15px"
        }}>
            <h1 style={{
                fontWeight: 900,
                fontSize: isMobile ? 23 : 36,
                color: "#97a2b5ff",
                marginBottom: isMobile ? 15 : 26,
                textAlign: isMobile ? "center" : "left"
            }}>
                Work & Project Experience
            </h1>
            <div style={{
                display: "flex",
                flexDirection: "column",
                gap: isMobile ? 16 : 28
            }}>
                {WORKS.map(work => {
                    const [isCardHovered, setIsCardHovered] = React.useState(false);
                    const [isVisible, setIsVisible] = React.useState(false);

                    React.useEffect(() => {
                        setIsVisible(true);
                    }, []);

                    return (
                        <div
                            key={work.role + work.company}
                            onMouseEnter={() => setIsCardHovered(true)}
                            onMouseLeave={() => setIsCardHovered(false)}
                            style={{
                                background: "#EDF2FB",
                                borderRadius: 14,
                                padding: isMobile ? 13 : 27,
                                boxShadow: "0 2px 14px #c0c7ef15",
                                marginBottom: isMobile ? 5 : 8,
                                transition: "transform 0.3s ease, opacity 0.5s ease",
                                transform: isCardHovered ? "scale(1.02)" : "scale(1)",
                                opacity: isVisible ? 1 : 0
                            }}
                        >
                            <div style={{
                                fontSize: isMobile ? 15.5 : 22,
                                fontWeight: 800,
                                color: "#232751"
                            }}>{work.role}</div>
                            <div style={{
                                fontSize: isMobile ? 13 : 18,
                                marginBottom: isMobile ? 4 : 6
                            }}>
                                <b>{work.company}</b> — <span style={{ color: "#7B9ACC", fontWeight: 600 }}>{work.period}</span>
                            </div>
                            <div style={{
                                color: "#6B7C8A",
                                fontSize: isMobile ? 10.5 : 15,
                                marginBottom: isMobile ? 5.5 : 8
                            }}>{work.location}</div>
                            <div style={{
                                fontSize: isMobile ? 13.5 : 17,
                                lineHeight: 1.6,
                                color: "#22253B",
                                marginBottom: isMobile ? 9 : 12
                            }}>{work.summary}</div>
                            <div style={{
                                display: "flex",
                                gap: isMobile ? 6 : 9,
                                flexWrap: "wrap"
                            }}>
                                {work.stack.map(s => (
                                    <div key={s.name} style={{ position: "relative", marginBottom: isMobile ? 5 : 0 }}>
                                        <span
                                            onMouseEnter={() => setHoveredSkill(s.name)}
                                            onMouseLeave={() => setHoveredSkill(null)}
                                            style={{
                                                background: "#D0DEFA",
                                                color: "#232751",
                                                borderRadius: 11,
                                                padding: isMobile ? "4px 7vw" : "5px 15px",
                                                fontWeight: 700,
                                                fontSize: isMobile ? 11.2 : 15,
                                                cursor: "pointer",
                                                display: "inline-block",
                                                transition: "background 0.2s ease"
                                            }}
                                        >{s.name}</span>
                                        {hoveredSkill === s.name && (
                                            <div style={{
                                                position: "absolute",
                                                top: "100%",
                                                left: 0,
                                                background: "#FFFFFF",
                                                border: "1px solid #CCCCCC",
                                                borderRadius: 8,
                                                padding: isMobile ? 8 : 12,
                                                boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
                                                zIndex: 10,
                                                width: isMobile ? "80vw" : 300,
                                                fontSize: isMobile ? 12 : 14,
                                                color: "#22253B",
                                                lineHeight: 1.4,
                                                transition: "opacity 0.2s ease",
                                                opacity: 1
                                            }}>
                                                {s.description}
                                            </div>
                                        )}
                                    </div>
                                ))}
                            </div>
                        </div>
                    );
                })}
            </div>
        </div>
    );
}
